import { DefaultTheme } from "react-native-paper";

export const theme = {
  ...DefaultTheme,
  colors: {
    ...DefaultTheme.colors,
    text: "#A3C7D6",
    primary: "#3F3B6C",
    secondary: "#624F82",
    error: "#E14D2A",
  },
};
